import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome on our discord Page</h1>
      </header>
      <div class="content-box">
        <iframe src="https://discord.com/widget?id=905092436081115147&theme=dark" width="350" height="500" allowtransparency="true" frameborder="0" sandbox="allow-popups allow-popups-to-escape-sandbox allow-scripts" class="discordtest "></iframe>
      </div>

    </div>
  );
}

export default App;
